import React from 'react';

import profile from '../../assets/images/icons/user.svg';

import './styles.css';

function Form(){
    return(
        <article className="teacher-item">
        <header>
            {/* <input type="file" id="myfile" name="myfile"> */}
            <img typeof="file" src={profile} alt="Insira sua foto de perfil"/>
            {/* </input> */}
            <p contentEditable="true">Insira seu nome</p>
        </header>
             
             <footer>

             <form className="search-teachers page-teacher-list">
               <div className="input-block">
                <label htmlFor="subject">Tecnologia</label>
               <input type=" text" id="subject">
               </input>
               </div>  

               <div className="input-block">
                <label htmlFor="week_day">Disponibilidade</label>
               <input type=" text" id="week_day">
               </input>
               </div>  

               <div className="input-block">
                <label htmlFor="time">Pre√ßo</label>
               <input type=" text" id="time">
               </input>
               </div>  

              </form>  

                
                 {/* <button type="button">
                     <img src="{whatsappIcon}" alt="whatsapp"/>
                     <p> Entrar em contado </p>
                 </button> */}
             </footer>
    </article>
    
    );


}


export default Form;
